@Component({
  selector: 'app-admin',
  templateUrl: './admin.component.html',
  styleUrls: ['./admin.component.scss']
})
export class AdminComponent {

  constructor(private authService: AuthService) { }
   
  logout(){
    this.authService.logout();
  }

}
